import React from 'react';
import Car from './Car';

const getCars = () => {
    return [
        { 
            brand: 'Ford',
            model: 'Mustang',
            type: 'car',
            year: 2021, 
            color: 'red',
            registration: {
                city: 'Houston',
                state: 'Texas',
                country: 'USA'
            }
        },

    ]
}

const Cars = () => {
    const {brand ,model ,type} = getCars();
    return (
        <Car brand={brand} model={model} type={type} />
    )
}

export default Cars;
